CREATE TABLE `report_output_lookup` (
  `id` int(11) NOT NULL auto_increment,
  `groupId` int(11) NOT NULL,
  `tableName` varchar(255) NOT NULL,
  `columnName` text NOT NULL,
  `status` int(11) NOT NULL default '0',
  `description` varchar(255) default NULL,
  `displayName` varchar(255) NOT NULL,
  `valueListProperty` varchar(255) NOT NULL,
  `valueListTitle` varchar(255) NOT NULL,
  `valueListSortable` tinyint(1) NOT NULL,
  `valueListAttributes` varchar(255) default NULL,
  `valueListAttributes2` varchar(255) default NULL,
  `valueListFormat` varchar(255) default NULL,
  `columnType` int(11) NOT NULL,
  `isLink` tinyint(1) NOT NULL default '0',
  `linkUrl` varchar(255) default NULL,
  `groupType` int(11) NOT NULL default '0',
  `letterCase` tinyint(1) NOT NULL default '0',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



CREATE TABLE `report_output_map` (
  `id` int(11) NOT NULL auto_increment,
  `reportId` int(11) NOT NULL,
  `lookupGroupId` int(11) NOT NULL,
  `status` int(11) default '0',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;






